import {Mainpage} from "./Mainpage"
import {SignIn} from "./Mainpage/containers/SignIn";
import {SignUp} from "./Mainpage/containers/SignUp";
import { MainFooter } from "./Mainpage/containers/MainFooter";
import Routes from './config/Routes';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  return (
      <Router>
        <Switch>
        <Route
                path='/:category/search/:keyword'
                component={Catalog}
            />
            <Route
                path='/:category/:id'
                component={Detail}
            />
            <Route
                path='/:category'
                component={Catalog}
            />
            <Route
                path='/home'
                exact
                component={Home}
            />

        </Switch>
      </Router>
  );
}

export default App;
